import React, { Suspense } from 'react'
import './style.css'
import pokemonsData from './pokemons.json'
import imageloading from './pokeball.svg'
const PokemonCard = React.lazy(() => import('./PokemonCard'))

export default function PokemonList()
{

    return(
        <div className="list">
            {pokemonsData.map((item, id) => {
                return(
                    <div key={id}>
                        <Suspense fallback={<PokemonCard id={item.id} name={item.names.fr} img={imageloading} type={item.types.filter(t => t.includes(''))} type={item.types.map(function (typ, i){return(<span key={i}>{typ} </span>)})}/>}>
                            <PokemonCard id={item.id} name={item.names.fr} img={item.image} type={item.types.filter(t => t.includes(''))} type={item.types.map(function (typ, i){return(<span key={i}>{typ} </span>)})}/>
                        </Suspense>
                    </div>
                );
            })}
        </div>
    );
}
